import React, {Component} from "react";
import { createClient } from "../converters/clientConverter";

//css
import "../assets/css/Login.css";
import logo from '../assets/images/LOGOPRO.png';
import {Apiurl} from '../services/apirest';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import  {Link} from 'react-router-dom';

class Register extends Component{


    constructor(props){
        super(props);
    }


    state={
        form:{
            "name": "",
            "birthdate": "",
            "email": "",
            "password": "",
            "code": ""    

        },
        error:false,
        errorMsg:""
    }




    manejadorSubmit = e => {
        e.preventDefault();
    }


    manejadorChange = async e => {
            await this.setState({
                form:{
                    ...this.state.form,
                    [e.target.name]: e.target.value
                }
            })
         
    }


    

    post = () => {
        let url = ("https://siglo-xxi-users.azurewebsites.net/Users/v1/users");
        const body = createClient(this.state.form);
        axios
          .post(url, body)
          .then((response) => {
            
          swal(
            'Bienvenido',
            'Ya puedes iniciar sesi칩n',
            'success' 
        )
        
            this.props.history.push("/");
          })
          .catch((error) => console.log(error.response.data));
      };



    
    render(){

        return(
               
        <React.Fragment>

                    <div id="fondito" className="wrapper fadeInDown">
                    <div id="formContent">
                    
                        <div className="fadeIn first">
                    

                        <h7><strong>Registrarte</strong></h7>        
                        <p>Es r치pido y f치cil.</p>


                        <div className="row">
                      <div className="col-sm-8">
                     <label className="col-md-2 control-label">Nombre</label>
                     <div className="col-md-6">
                         <input className="form-control" name="name" placeholder="Nombre" type="text"  maxLength={20}
                         onChange={this.manejadorChange}
                         onKeyPress={(e) => this.fourthMethod(e)}
                         
                         />
                       </div>
                </div>
                 </div>
                 <br/>
                 <br/>















                        </div>

                      

                    </div>
                    </div>

                   
        </React.Fragment>
        
               
        );
    }

}


export default Register;
